  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0123096 contains raw underway
  meteorological, navigational, physical, profile and time series data logged by the
  Scientific Computer System (SCS) aboard NOAA Ship Ronald H. Brown in the Coral Sea,
  North Pacific Ocean and South Pacific Ocean from 2014-10-06 to 2014-11-01. Office
  of Marine and Aviation Operations (OMAO) personnel aboard the ship submitted these
  data and associated metadata to NODC. In addition, NODC Accession 0123096 contains
  supplementary cruise-level metadata, which OMAO personnel logged in the Ship Daily
  Activity Log (SDAL). OMAO and NODC personnel developed the automated process to
  archive these data under the auspices of the NOAA Rolling Deck to Repository (NOAA
  R2R) program.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
